import React from "react";
import HeaderNavigation from "../HeaderNavigation";
import DividerChevronTypeTextBreakpointDes2 from "../DividerChevronTypeTextBreakpointDes2";
import BreadcrumbsFalseSupportingTextTrueS3 from "../BreadcrumbsFalseSupportingTextTrueS3";
import SupportingTextFalseStyleSimpleActio2 from "../SupportingTextFalseStyleSimpleActio2";
import TextTrueCheckboxFalseColorWhite from "../TextTrueCheckboxFalseColorWhite";
import "./Dashboard3Empty.sass";

class Dashboard3Empty extends React.Component {
  render() {
    const {
      text1,
      text2,
      headerNavigationProps,
      dividerChevronTypeTextBreakpointDes2Props,
      breadcrumbsFalseSupportingTextTrueS3Props,
      supportingTextFalseStyleSimpleActio2Props,
      textTrueCheckboxFalseColorWhite1Props,
      textTrueCheckboxFalseColorWhite2Props,
      textTrueCheckboxFalseColorWhite3Props,
      textTrueCheckboxFalseColorWhite4Props,
      textTrueCheckboxFalseColorWhite5Props,
      textTrueCheckboxFalseColorWhite6Props,
      textTrueCheckboxFalseColorWhite7Props,
      textTrueCheckboxFalseColorWhite8Props,
    } = this.props;

    return (
      <div className="container-center-horizontal">
        <div className="dashboard-3-empty screen">
          <HeaderNavigation
            companyLogoProps={headerNavigationProps.companyLogoProps}
            typeAvatarOpenFalseProps={headerNavigationProps.typeAvatarOpenFalseProps}
          />
          <div className="main-4">
            <DividerChevronTypeTextBreakpointDes2
              currentFalseTypeTextIconFalseStateD1Props={
                dividerChevronTypeTextBreakpointDes2Props.currentFalseTypeTextIconFalseStateD1Props
              }
              currentFalseTypeTextIconFalseStateD2Props={
                dividerChevronTypeTextBreakpointDes2Props.currentFalseTypeTextIconFalseStateD2Props
              }
              currentTrueTypeTextIconFalseStateDeProps={
                dividerChevronTypeTextBreakpointDes2Props.currentTrueTypeTextIconFalseStateDeProps
              }
            />
            <BreadcrumbsFalseSupportingTextTrueS3
              sizemdHierarchySecondaryGrayIconLea2Props={
                breadcrumbsFalseSupportingTextTrueS3Props.sizemdHierarchySecondaryGrayIconLea2Props
              }
            />
            <div className="table-1 border-1px-gallery">
              <SupportingTextFalseStyleSimpleActio2
                sizesmIconFalseColorPrimaryProps={
                  supportingTextFalseStyleSimpleActio2Props.sizesmIconFalseColorPrimaryProps
                }
                sizemdHierarchySecondaryGrayIconLea2Props={
                  supportingTextFalseStyleSimpleActio2Props.sizemdHierarchySecondaryGrayIconLea2Props
                }
              />
              <div className="filters-bar-1"></div>
              <div className="content-38">
                <div className="column-7">
                  <TextTrueCheckboxFalseColorWhite
                    className={textTrueCheckboxFalseColorWhite1Props.className}
                    helpIconFalseArrowFalseStateDefaultProps={
                      textTrueCheckboxFalseColorWhite1Props.helpIconFalseArrowFalseStateDefaultProps
                    }
                  />
                  <div className="divider-36"></div>
                </div>
                <div className="overlap-group1-3">
                  <div className="column-8">
                    <TextTrueCheckboxFalseColorWhite
                      className={textTrueCheckboxFalseColorWhite2Props.className}
                      helpIconFalseArrowFalseStateDefaultProps={
                        textTrueCheckboxFalseColorWhite2Props.helpIconFalseArrowFalseStateDefaultProps
                      }
                    />
                    <div className="divider-37"></div>
                  </div>
                  <div className="column-9">
                    <TextTrueCheckboxFalseColorWhite
                      className={textTrueCheckboxFalseColorWhite3Props.className}
                      helpIconFalseArrowFalseStateDefaultProps={
                        textTrueCheckboxFalseColorWhite3Props.helpIconFalseArrowFalseStateDefaultProps
                      }
                    />
                    <div className="divider-38"></div>
                  </div>
                  <div className="column-10">
                    <TextTrueCheckboxFalseColorWhite
                      className={textTrueCheckboxFalseColorWhite4Props.className}
                      helpIconFalseArrowFalseStateDefaultProps={
                        textTrueCheckboxFalseColorWhite4Props.helpIconFalseArrowFalseStateDefaultProps
                      }
                    />
                    <div className="divider-39"></div>
                  </div>
                  <div className="column-11">
                    <TextTrueCheckboxFalseColorWhite
                      className={textTrueCheckboxFalseColorWhite5Props.className}
                      helpIconFalseArrowFalseStateDefaultProps={
                        textTrueCheckboxFalseColorWhite5Props.helpIconFalseArrowFalseStateDefaultProps
                      }
                    />
                    <div className="divider-40"></div>
                  </div>
                  <div className="overlap-group-19">
                    <div className="column-12">
                      <TextTrueCheckboxFalseColorWhite
                        className={textTrueCheckboxFalseColorWhite6Props.className}
                        helpIconFalseArrowFalseStateDefaultProps={
                          textTrueCheckboxFalseColorWhite6Props.helpIconFalseArrowFalseStateDefaultProps
                        }
                      />
                      <div className="divider-41"></div>
                    </div>
                    <div className="frame-33766">
                      <img
                        className="a1e5ce627f3fd3fb5e05d6ae03dde4bf-1"
                        src="/img/a1e5ce627f3fd3fb5e05d6ae03dde4bf-1@2x.svg"
                      />
                      <div className="text-134 inter-medium-mirage-18px">{text1}</div>
                      <p className="text-135 inter-normal-pale-sky-16px">{text2}</p>
                    </div>
                  </div>
                </div>
                <div className="column-13">
                  <TextTrueCheckboxFalseColorWhite
                    className={textTrueCheckboxFalseColorWhite7Props.className}
                    helpIconFalseArrowFalseStateDefaultProps={
                      textTrueCheckboxFalseColorWhite7Props.helpIconFalseArrowFalseStateDefaultProps
                    }
                  />
                  <div className="divider-42"></div>
                </div>
                <div className="column-14">
                  <TextTrueCheckboxFalseColorWhite
                    className={textTrueCheckboxFalseColorWhite8Props.className}
                    helpIconFalseArrowFalseStateDefaultProps={
                      textTrueCheckboxFalseColorWhite8Props.helpIconFalseArrowFalseStateDefaultProps
                    }
                  />
                  <div className="divider-43"></div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Dashboard3Empty;
